import React, { useEffect } from "react";

const BookingWidget = () => {
  useEffect(() => {
    const script = document.createElement("script");
    script.src = "https://widget.simplybook.me/v2/widget/widget.js";
    script.async = true;

    script.onload = () => {
      if (window.SimplybookWidget) {
        new window.SimplybookWidget({
          widget_type: "button",
          url: "https://vachatech.simplybook.it",
          theme: "simple",
          theme_settings: {
            timeline_hide_unavailable: "1",
            hide_past_days: "1",
            sb_base_color: "#ff6600",
            sb_primary_color: "#ffffff",
            sb_text_color: "#333333"
          },
          button_title: "Réserver un rendez-vous",
          app_config: {
            clear_session: 1
          }
        });
      }
    };

    document.body.appendChild(script);
  }, []);

  return <div id="sb-widget"></div>;
};

export default BookingWidget;
